    "2013-03-19T00:35:56.223090",nt"name": "line-grid-and-vector-data-and-maps-for-the-airborne-geophysical-survey-data-of-the-styx-river-s",nt"isopen":
    false,nt"url": null,nt"notes": "This digital publication, GPR 2008-3, contains
    data produced from airborne geophysical surveys conducted in 2007 and 2008 for the
    Styx River Survey area, southcentral Alaska. Aeromagnetic and electromagnetic data
    were acquired for about 715 sq miles. Data provided in GPR 2008-3 include (1) raw
    and processed linedata in Geosoft ASCII XYZ files, (2) gridded files of magnetic
    data, a calculated vertical magnetic gradient (first vertical derivative), apparent
    resistivity data, and a digital elevation model, (3) flight lines in vector format,
    and maps of the data in PDF format. Data are described in more detail in the 'gpr2008_003_readme.pdf'
    and 'Styx-Linedata.txt' files included on the DVD.",nt"license_title": null,nt"extras":
